    properBar = <li className="nav-links"><a href="register" data-value="register" onClick={props.click}>profile</a></li>
}else{
    properBar = <React.Component>
                    <li className="nav-links"><a href="register" data-value="register" onClick={props.click}>Register</a></li>
                    <li className="nav-links"><a href="login" data-value="login" onClick={props.click}>Login</a></li>
                </React.Component>
}
    <nav className="nav-primary">
    <ul>
        {properBar}
